import React, { useState, useEffect, useContext } from 'react';
import {
    Header, Icon, Form, Image, Message,
    Segment, Grid, Modal, Search, Button, Dimmer, Loader, Divider, List, Accordion
} from 'semantic-ui-react';


const Registration_Summary = () => {

    return (
        <Grid textAlign='center' verticalAlign='middle'>
            <Grid.Column style={{ maxWidth: 450 }}>
                <Header as='h2' color='black' textAlign='center' style={{ padding: "10px" }}>
                    Summary
                </Header>
                <RenderAccordion summary="names" />
            </Grid.Column>
        </Grid>
    )
}

export const RenderAccordion = ({ summary }) => {

    return (
        <Accordion>
        <Accordion.Title>
        <Icon name='dropdown' />
          What is a dog?
        </Accordion.Title>
            <Accordion.Content>
                <p>
                    A dog is a type of domesticated animal. Known for its loyalty and
                    faithfulness, it can be found as a welcome guest in many households
                    across the world.
          </p>
            </Accordion.Content>
        </Accordion>
    )
}

export default Registration_Summary;
